import React from 'react';
import Project from "../components/Projects/Project";
import projectsList from '../utils/projects-list';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Container, Row } from 'react-bootstrap';

export default function Projects(props) {

    const [titleFall, setTitleFall] = React.useState(true)

    // const handleSkillsClick = () => {

    // }

    return (
        <div>
            <Container>
                <div className="project-examples col-md-12 flex">
                    <Row className="example-items">
                        {titleFall ? 
                            <>
                                <h1>P</h1>
                                <h1>R</h1>
                                <h1>O</h1>
                                <h1>J</h1>
                                <h1>E</h1>
                                <h1>C</h1>
                                <h1>T</h1>
                                <h1>S</h1>
                            </>
                        :
                            <div className="projects">
                                <h1>Projects</h1>
                            </div>
                        }
                        {projectsList.map(list => {
                            return (
                                <Project 
                                    name={list.name}
                                    image={list.image}
                                    deployed={list.deployed}
                                    href={list.deployed}
                                />
                            )
                        })}
                    </Row>
                </div>
                {/* <Row>
                    <div 
                        className="skills-button"
                        onClick={handleSkillsClick}
                    >
                        <p>Still here?</p>
                        <p>Check out my skills!</p>
                    </div>
                </Row> */}
            </Container>
        </div>
    );
}
